import React, { useState } from "react";

export const BookingContext = React.createContext();

const [carbookings, setCarbookings] = useState([
  { name: "Ashish", carNumber: "hr10r1100", phone: "23456" },
  { name: "invincible2828",carNumber: "ha10ajfa", phone: "234567" },
]);
function BookingsContextProvider(props) {
  return (
    <BookingContext.Provider value={{ carbookings, setCarbookings }}>
      {props.children}
    </BookingContext.Provider>
  );
}

export default BookingsContextProvider;
